import React from "react";

const StreamList = () => {
  return <div>StreamList</div>;
};

const animalSounds = { cat: 'meow', dog: 'bark'};
const animal = 'lion';
const sound = 'roar';
const newAnimalSounds = {...animalSounds, [animal]:sound }
console.log(newAnimalSound);

export default StreamList;
